        public static string SendMail(string from, string from_name, string to, string subject, string body, string username, string password, string server, string fujian = "")
        {
            try
            {
                //邮件发送类
                MailMessage mail = new MailMessage();
                //发送人
                mail.From = new MailAddress(from, from_name);
                //接受者
                mail.To.Add(to);
                //标题
                mail.Subject = subject; ;
                //内容编码
                mail.BodyEncoding = Encoding.Default;
                //优先级
                mail.Priority = MailPriority.High;
                //邮件内容
                mail.Body = body;
                //是否以HTML形式
                mail.IsBodyHtml = true;
                //附件
                if (fujian.Length > 0)
                {
                    mail.Attachments.Add(new Attachment(fujian));
                }
                //邮件服务器与端口
                SmtpClient smtp = new SmtpClient(server, 25);
                smtp.UseDefaultCredentials = true;
                //发送方式
                smtp.DeliveryMethod = SmtpDeliveryMethod.Network;
                //登录名和密码
                smtp.Credentials = new System.Net.NetworkCredential(username, password);
                //超时时间
                smtp.Timeout = 10000;
                smtp.Send(mail); ;
            }
            catch (Exception ex)
            {
                return ex.Message;
            }
            return "send ok";
        }
