        public static string kuaidi(string str, string str2)
        {
            string url = "http://www.kuaidi100.com/query?type={0}&postid={1}";
            string result = "";
            JsonObject js = Json.GetJsonByHtml(string.Format(url, str, str2), Encoding.UTF8);
            Dictionary<string, object> dic1 = (Dictionary<string, object>)js.Value;
            IEnumerable<KeyValuePair<string, object>> messges = dic1.Where(p => p.Key == "data");
            foreach (KeyValuePair<string, object> message in messges)
            {
                object[] ob = (object[])message.Value;
                foreach (object o in ob)
                {
                    Dictionary<string, object> dic2 = (Dictionary<string, object>)o;
                    result += ("时间：" + dic2["time"] + "  状态：" + dic2["context"].ToString());
                    result += " ";
                }
            }
            return result;
        }
