        /// <summary>
        /// 汉字转换为utf-8编码
        /// </summary>
        /// <param name="str">要编码的汉字字符串</param>
        /// <returns>Unicode编码的的字符串</returns>
        public static string ToUTF(string str)
        {
            byte[] bt = Encoding.GetEncoding("utf-8").GetBytes(str);
            string a = "";
            foreach (byte b in bt)
            {
                a += string.Format("%{0:X}", b);
            }
            //string a = "";
                return a;
        }
