        //学习功能
        public static string Study(string teachMessage,string studyMessage)
        {
            string reply = "";
            XmlDocument xml = new XmlDocument();
            xml.Load("qq.xml");
            if (xml.SelectSingleNode("study").SelectSingleNode(teachMessage)!=null)
            {
                reply = "小安安好像已经学过这个了耶...么么哒";
                return reply;
            }
            else
            {
                XmlElement xe = xml.CreateElement(teachMessage);
                xe.InnerText = studyMessage;
                xml.SelectSingleNode("study").AppendChild(xe);
                xml.Save("qq.xml");
                reply = "是咩？小安安书读的少，不要骗我哦...";
                return reply;
            }
        }
